using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Text.RegularExpressions;
using System.Threading.Tasks;

namespace AdventOfCode2018
{
    public class Five
    {
        public static void Part1()
        {
            Reset();
            React();
            //Console.WriteLine($"{Input} - Result");
            Console.WriteLine($"Number of remaining units is: {Input.Length}");
        }

        public static void Part2()
        {
            Reset();
            int minLength = int.MaxValue;
            char problemChar = (char)97;
            for(char c = (char)97; c < 123; c++)
            {
                Remove(c);
                React();
                int currentLength = Input.Length;
                if (currentLength < minLength) problemChar = c;
                minLength = Math.Min(currentLength, minLength);
                Console.WriteLine($"{c}: {currentLength} => " + (minLength == currentLength ? "Better" : ""));
                Reset();
            }
            Console.WriteLine($"Best is: {minLength} using char {problemChar}");
        }

        public static string Input { get; set; }

        public static void Remove(char c)
        {
            char upper = char.ToUpper(c);
            char lower = char.ToLower(c);
            Input = Input.Replace($"{upper}", "").Replace($"{lower}", "");
        }

        public static void Reset()
        {
            Input = FullInput;
        }

        public static void React()
        {
            bool simplify = false;
            //Console.WriteLine($"{Input} - Initial");
            do
            {
                char lastChar = Input.First();
                int index = 1;
                simplify = false;
                foreach (char c in Input.Skip(1))
                {
                    if ((char.IsUpper(c) ^ char.IsUpper(lastChar)) && char.ToUpper(c) == char.ToUpper(lastChar))
                    {
                        simplify = true;
                        break;
                    }
                    lastChar = c;
                    index++;
                }
                if (simplify)
                {
                    if (index == 1) Input = Input.Substring(2);
                    else Input = Input.Substring(0, index - 1) + Input.Substring(index + 1);
                }
                //Console.WriteLine($"position: {index}");
                //Console.WriteLine($"{Input}");
            } while (simplify);
        }


        public static string TestInput { get; set; } = "dabAcCaCBAcCcaDA";
        public static string FullInput { get; set; } = "";
    }
}
